func httpServerForSign() {
	r := gin.New()
	r.POST("/wapApiPro", func(c *gin.Context) {
		proRequest := new(WapApiProRequest)
		proResponse := new(WapApiProResponse)
		defer func() {
			c.JSON(http.StatusOK, proResponse)
		}()
		if err := c.BindJSON(proRequest); err != nil {
			proResponse.Message = "Invalid request"
			return
		}
		logrus.Error(utils.ToJson(proRequest))
		if proRequest.ClientSn == "" || proRequest.TotalAmount == "" || proRequest.ReturnUrl == "" {
			proResponse.Message = "clientSn or totalAmount or returnUrl is empty"
			proResponse.Code = "common.ERR_INVALID_PARAM"
			return
		}
		//channelId := 1
		//agentCode := proRequest.AgentCode
		//var err error
		//proResponse.Data.Url, err = shouqianba.GenOrderPayUrlByWapApiPro(proRequest.ClientSn, proRequest.TotalAmount, agentCode, channelId, proRequest.ReturnUrl)
		//proResponse.Success = err == nil
	})

	srv := &http.Server{
		Addr:    ":8081",
		Handler: r,
	}
	go func() {
		// service connections
		if err := srv.ListenAndServe(); err != nil {
			logrus.Printf("listen: %s\n", err)
		}
	}()
	select {}
}

