func decimal(value float64) float64 {
	// 只去浮点数的小数点后两位
	return RoundNum(value, 0)
}

func RoundNum(f float64, n int) float64 {
	pow10_n := math.Pow10(n)
	return math.Trunc((f+0.5/pow10_n)*pow10_n) / pow10_n
}

func toString(data []int, stp string) (str string) {
	for _, v := range data {
		str += fmt.Sprintf("%d%s", v, stp)
	}
	if len(str) >= len(stp) && str[len(str) -len(stp):] == stp {
		str = str[:len(str) -len(stp)]
	}
	return str
}

