var order_ids = ""

func getHotelIds(file string) {
	// 打开文件
	xlFile, err := xlsx.OpenFile(file)
	if err != nil {
		log.Println("打开文件失败！" + err.Error())
		return
	}
	if len(xlFile.Sheets) == 0 {
		log.Println("没有找到工作表")
	}
	sum := float64(0)
	i := 0
	for k, row := range xlFile.Sheets[0].Rows {
		if k == 0 {
			continue
		}
		order_id := row.Cells[5].String()
		if strings.Contains(order_ids, order_id) {
			num, err := row.Cells[6].Float()
			if err != nil {
				log.Println("get num failed, ", order_id)
			}
			sum += num
			i++
		}
	}
	log.Println("sum:", sum, i)
}

func printStr(ids []int, symbol string) string {
	str := ""
	strMap := make(map[int]bool)
	for _, id := range ids {
		if _, ok := strMap[id]; !ok {
			strMap[id] = true
			str += fmt.Sprintf("\"%s%d\",", symbol, id)
		}
	}
	log.Println("idsMap len:", len(strMap))
	strInt := ""
	for id, _ := range strMap {
		strInt += fmt.Sprintf("%d,", id)
	}
	log.Println("strInt:", strInt)
	if len(str) > 0 {
		return str[:len(str)-1]
	}
	return ""
}

func orderIdDiff(billOrderIds []int, checkOrderIds []int) {
	_, deBillOrderIds := Deduplicate(billOrderIds)
	_, deCheckOrderIds := Deduplicate(checkOrderIds)
	log.Println("bill:", len(deBillOrderIds), "check:", len(deCheckOrderIds))
	count := 0
	for id, _ := range deBillOrderIds {
		if _, ok := deCheckOrderIds[id]; !ok {
			log.Println("diff:", id)
			count++
		}
	}
	log.Println("diff count:", count)

}

