//去重
func Deduplicate(ids []int) ([]int, map[int]int) {
	deMap := make(map[int]int)
	for _, id := range ids {
		if v, ok := deMap[id]; ok {
			deMap[id] = v + 1
		} else {
			deMap[id] = 1
		}
	}
	de := make([]int, 0, len(deMap))
	for id, _ := range deMap {
		de = append(de, id)
	}
	return de, deMap
}

