func initDumpToFile() {
	file = xlsx.NewFile()
	sheet, fileErr = file.AddSheet("Sheet1")
	if fileErr != nil {
		log.Println(fileErr.Error())
	}
	row = sheet.AddRow()
	row.AddCell().Value = "s_region_id"
	row.AddCell().Value = "ean_region_id"
	row.AddCell().Value = "ean_parent_region_id"
	row.AddCell().Value = "ean_parent_region_id_changed"
	row.AddCell().Value = "region_name"
}

